import targetDataModel, { TargetItem } from '../dataModel/TargetDataModel'
import TargetList from '../view/TargetsList'
import AddDialog from '../view/addDialog'

@Entry
@Component
struct Index {
  @State targetList: TargetItem[] = targetDataModel.getData()
  @Provide @Watch('onItemChange') isListItemChangeBol: boolean = false
  customAddDialog: CustomDialogController = new CustomDialogController({
    builder: AddDialog({
      onConfirm: (value: string) => {
        this.saveData(value)
      }
    }),
    offset: {
      dy: -5,
      dx: 0
    },
    alignment: DialogAlignment.Bottom,
    autoCancel: false,
    customStyle: true
  })
  @State total: number = 0
  @State doneTotal: number = 0
  @State lastUpdateDate: string = ''

  aboutToAppear(){
    targetDataModel.setMockData()
  }

  onItemChange() {
    this.total = this.targetList.length
    this.doneTotal = this.targetList.filter(item => item.progress === 100).length
    this.lastUpdateDate = utils.getNow()
  }

  handleOpenAddDialog() {
    this.customAddDialog.open()
  }

  saveData(value) {
    targetDataModel.addData(value)
    this.targetList = targetDataModel.getData()
    this.isListItemChangeBol = !this.isListItemChangeBol

    this.customAddDialog.close()
  }

  build() {
    Column() {
      Column() {
        Text('工作目标').fontSize(25).fontWeight(FontWeight.Bold).textAlign(TextAlign.Start)
        Column() {
          Row() {
            Image($r('app.media.ic_main')).clip(true).objectFit(ImageFit.Cover).height('100%').aspectRatio(1)
            Column() {
              Text('第一季度运营目标').fontSize(18).fontWeight(FontWeight.Bold)
              Text('实现用户量与用户活跃是提升').fontSize(15).fontColor('gray').margin({ top: 10 })
            }.height('100%').justifyContent(FlexAlign.Center).alignItems(HorizontalAlign.Start).padding({ left: 15 })
          }.height(90).width('100%').margin({ bottom: 10 })

          Row() {
            Column() {
              Text('整体进度').fontWeight(FontWeight.Bold).fontSize(15).margin({ bottom: 3 })
              Text(`更新时间：${this.lastUpdateDate || '----'}`).fontColor('gray').fontSize(14)
            }.alignItems(HorizontalAlign.Start)

            Stack() {
              Progress({ value: (this.doneTotal / this.total) * 100, type: ProgressType.Ring }).height('90%')
              Text() {
                Span(this.doneTotal.toString()).fontColor($r('app.color.second_theme_color'))
                Span('/')
                Span(this.total.toString())
              }.fontSize(14)
            }
          }.width('100%').height(50).justifyContent(FlexAlign.SpaceBetween).alignItems(VerticalAlign.Center)
        }
        .width('100%')
        .backgroundColor('#ffffff')
        .borderRadius(15)
        .padding(15)
        .margin({ top: 15 })
      }.normalColumnContainerSty()

      Column() {
        TargetList({
          targetList: $targetList,
          handleOpenAddDialog: () => this.handleOpenAddDialog()
        })
      }.normalColumnContainerSty().height('67%')
    }.width('100%').height('100%').backgroundColor('#f1f2f5')
  }
}

@Extend(Column) function normalColumnContainerSty() {
  .width('100%')
  .alignItems(HorizontalAlign.Start)
  .padding({ left: 15, right: 15, top: 15 })
}

