import utils from '../Common/utils'

class TargetDataModel {
  targetList: TargetItem[] = []

  getData() {
    return this.targetList
  }

  setMockData() {
    this.addData('111')
    this.addData('222')
    this.addData('333')
  }

  addData(name: string) {
    this.targetList.push(
      new TargetItem(name, 0, utils.getNow())
    )
  }

  deleteData(indexArs: string[]) {
    this.targetList = this.targetList.filter((item) => indexArs.indexOf(item.id.toString()) === -1)
  }

  setDataLong(long: number, id: number) {
    const currentItemIndex: number = this.targetList.findIndex(item => item.id === id)
    const currentItem: TargetItem = this.targetList[currentItemIndex]
    currentItem.progress = long
    currentItem.lastUpdateDate = utils.getNow()
    currentItem.id = this.generateRandomId()
    this.targetList.splice(currentItemIndex, 1, currentItem)
  }

  generateRandomId(): number{
    return Math.round(Math.random() * 100000)
  }
}

const targetDataModel = new TargetDataModel()

export default targetDataModel

export class TargetItem {
  name: string
  progress: number
  lastUpdateDate: string
  isFold: boolean = true
  id: number

  constructor(name: string, progress: number, lastUpdateDate: string) {
    this.name = name
    this.progress = progress
    this.lastUpdateDate = lastUpdateDate
    this.id = Math.round(Math.random() * 100000)
  }
}

