import utils from '../Common/utils'
import targetDataModel, { TargetItem } from '../dataModel/TargetDataModel'
import ProgressEditBar from './ProgressEditBar'

@Component
struct TargetList {
  @Consume isListItemChangeBol: boolean
  @Link targetList: TargetItem[]
  handleOpenAddDialog: () => void
  @State isEdit: boolean = false
  @State isSelectAll: boolean = false
  @State selectItems: string[] = []
  @State openCurrentTarget: number = -1

  setEdit(bol: boolean) {
    this.isEdit = bol
  }

  handleDeleteItems() {
    targetDataModel.deleteData(this.selectItems)
    this.targetList = targetDataModel.getData()

    this.isEdit = false
    this.isSelectAll = false
    this.isListItemChangeBol = !this.isListItemChangeBol
  }

  handleSetItem(long: number, id: number) {
    targetDataModel.setDataLong(long, id)
    this.targetList = targetDataModel.getData()

    this.openCurrentTarget = -1
    this.isListItemChangeBol = !this.isListItemChangeBol
  }

  @Builder
  ListItemBuilder(targetItem: TargetItem) {
    Row() {
      Column() {
        Row() {
          Text(targetItem.name).fontSize(15).fontWeight(FontWeight.Bold)
          Row() {
            Column() {
              Text(targetItem.progress.toString() + '%').fontSize(14).fontWeight(FontWeight.Bold).margin({ bottom: 3 })
              Text(`更新时间：${targetItem.lastUpdateDate}`).fontSize(12).fontColor('gray')
            }.alignItems(HorizontalAlign.End)
          }.justifyContent(FlexAlign.End)
        }.width('100%')
        .height(45)
        .justifyContent(FlexAlign.SpaceBetween)
        .alignItems(VerticalAlign.Center)
        //   progress
        Blank()
        if (this.openCurrentTarget === targetItem.id) {
          ProgressEditBar({
            enabled: !this.isEdit,
            long: targetItem.progress,
            onConfirm: long => this.handleSetItem(long, targetItem.id)
          })
        }
      }
      .width(this.isEdit ? '90%' : '100%')
      .height(this.openCurrentTarget === targetItem.id ? 120 : 45)
      .animation({ duration: 250 })
      .alignItems(HorizontalAlign.Start)

      if (this.isEdit) {
        Row() {
          Checkbox({ name: `checkItem_${targetItem.id}`, group: 'targetsGroup' })
        }.margin({ left: 10, right: 10 })
      }
    }
    .width('100%')
    .borderRadius(10)
    .padding(10)
    .clip(true)
    .itemTheme(targetItem.progress === 100, this.selectItems.indexOf(targetItem.id.toString()) !== -1)
    .onClick(() => {
      if (this.isEdit) return;
      this.openCurrentTarget = this.openCurrentTarget === targetItem.id ? -1 : targetItem.id
    })
  }

  build() {
    Column() {
      Row() {
        Text('子目标').fontSize(20).fontWeight(FontWeight.Bold).textAlign(TextAlign.Start)
        if (this.targetList.length > 0) {
          Row() {
            if (this.isEdit) {
              Text('取消').fontColor($r('app.color.second_theme_color')).fontSize(13).onClick(() => this.setEdit(false))
              Row() {
                Text('全选').fontColor($r('app.color.second_theme_color')).fontSize(13)
                CheckboxGroup({ group: 'targetsGroup' }).selectAll(this.isSelectAll).onChange((e) => {
                  // checkItem_0 -> 0
                  this.selectItems = e.name.map(item => item.split('_')[1])
                }).width(15)
              }.alignItems(VerticalAlign.Center).margin({ left: 5 })
            } else {
              Text('编辑').fontColor($r('app.color.second_theme_color')).fontSize(13).onClick(() => this.setEdit(true))
            }
          }
        }
      }.width('100%').alignItems(VerticalAlign.Center).justifyContent(FlexAlign.SpaceBetween)

      List({ space: 10 }) {
        ForEach(this.targetList, (targetItem: TargetItem) => {
          ListItem() {
            this.ListItemBuilder(targetItem)
          }
        }, (item: TargetItem) => item.id.toString())
      }.width('100%').margin({ top: 10 })

      Blank()
      if (this.isEdit) {
        Button('删除')
          .backgroundColor('#e6e7ea')
          .fontColor('red')
          .opacity(this.selectItems.length > 0 ? 1 : .3)
          .padding({ left: 30, right: 30 })
          .onClick(() => this.handleDeleteItems())
      } else {
        Button('添加子目标').backgroundColor('#e6e7ea').fontColor($r('app.color.second_theme_color'))
          .padding({ left: 30, right: 30 }).onClick(() => this.handleOpenAddDialog())
      }
    }.height('100%').width('100%')
  }
}

@Extend(Row) function itemTheme(isDone: boolean, isSelect: boolean) {
  .opacity(isDone ? .4 : 1)
  .backgroundColor(isSelect ? '#1A007DFF' : '#fff')
}

