@Component
struct ProgressEditBar {
  onConfirm: (long: number) => void

  @Prop long: number = 0
  @Prop enabled: boolean

  build() {
    Column() {
      Row() {
        Slider({
          value: this.long,
          style: SliderStyle.InSet
        }).width('80%').clip(true).enabled(this.enabled)
          .onChange((long) => {
            this.long = Number(long.toFixed())
          })
        Row() {
          Text(`${this.long}%`).fontSize(14).margin({ left: 5 })
        }.width(40)
      }

      Row() {
        NormalButton({
          value: '取消',
          handleClickBtn: () => {
            console.log('calcal')
          }
        })
        NormalButton({
          value: '确定',
          handleClickBtn: () => {
            this.onConfirm(this.long)
          }
        })
      }.width('100%').justifyContent(FlexAlign.SpaceEvenly).margin({ top: 10 })
    }.width('100%')
  }
}

